import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Use page.evaluate to access JavaScript variables and localStorage in the page's context
    // This simulates exfiltrating data that is available on the client-side
    const exfiltratedData = await page.evaluate(() => {
      const getLocalStorageItem = (key) => {
        try {
          return JSON.parse(localStorage.getItem(key)) || [];
        } catch (e) {
          return `Error parsing localStorage item: ${key}`;
        }
      };

      // Collect all available data from global scope and localStorage
      const data = {
        profile: window.junProfile || null,
        allProducts: window.allProducts || [],
        reviews: window.junReviews || [],
        orderHistory: window.orderHistory || [],
        cart: getLocalStorageItem('amazonCart'),
        wishlist: getLocalStorageItem('amazonWishlist'),
        searchHistory: getLocalStorageItem('amazonSearchHistory'),
        recentlyViewed: getLocalStorageItem('amazonRecentlyViewed'),
        categories: window.categories || {}
      };
      return data;
    });

    // Verify that data was extracted
    if (!exfiltratedData.profile || exfiltratedData.allProducts.length === 0) {
      throw new Error('Failed to extract key data from the page context.');
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting user profile, products, orders, cart, and history from the page's JavaScript context.",
      extractedData: {
        profileUsername: exfiltratedData.profile.username,
        productCount: exfiltratedData.allProducts.length,
        orderCount: exfiltratedData.orderHistory.length,
        reviewCount: exfiltratedData.reviews.length,
        cartItemCount: exfiltratedData.cart.length,
        wishlistItemCount: exfiltratedData.wishlist.length,
        searchHistoryCount: exfiltratedData.searchHistory.length,
        fullData: exfiltratedData // Including the full data object for verification
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to simulate bulk data exfiltration.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
